script: |
  super -f text -I q11921.spq | sort > q11921.out

inputs:
  - name: q11921.spq
    data: |
      SELECT DISTINCT col0 / + - col1, col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 + - col2 < - 26 * col0 + + ( + - col1 ) + + - 75;
  - name: tab0

outputs:
  - name: q11921.out
    data: |
      -4	87
      -97	97
      0	15
